import React, { useState, useEffect } from 'react';
import { GameState } from '../types/game';
import { Difficulty } from '../types/levels';
import './DynamicEffects.css';

interface DynamicEffectsProps {
  gameState: GameState;
  currentLevel: Difficulty;
  score: number;
  combo: number;
  timeRemaining: number;
}

const DynamicEffects: React.FC<DynamicEffectsProps> = ({
  gameState,
  currentLevel,
  score,
  combo,
  timeRemaining
}) => {
  const [screenShake, setScreenShake] = useState(false);
  const [colorPulse, setColorPulse] = useState(false);
  const [floatingTexts, setFloatingTexts] = useState<Array<{
    id: string;
    text: string;
    x: number;
    y: number;
    color: string;
  }>>([]);

  // 螢幕震動效果 (高連擊時)
  useEffect(() => {
    if (combo >= 8) {
      setScreenShake(true);
      setTimeout(() => setScreenShake(false), 500);
    }
  }, [combo]);

  // 顏色脈衝效果 (時間警告)
  useEffect(() => {
    setColorPulse(timeRemaining <= 20 && timeRemaining > 0);
  }, [timeRemaining]);

  // 漂浮文字效果
  const addFloatingText = (text: string, color: string) => {
    const id = Date.now().toString();
    const newText = {
      id,
      text,
      x: Math.random() * window.innerWidth,
      y: window.innerHeight * 0.3 + Math.random() * 200,
      color
    };
    
    setFloatingTexts(prev => [...prev, newText]);
    
    // 3秒後移除
    setTimeout(() => {
      setFloatingTexts(prev => prev.filter(t => t.id !== id));
    }, 3000);
  };

  // 分數變化時添加漂浮文字
  useEffect(() => {
    if (score > 0 && score % 500 === 0) {
      addFloatingText(`${score} Points!`, '#4ECDC4');
    }
  }, [score]);

  // 高連擊時添加特殊文字
  useEffect(() => {
    if (combo >= 5) {
      const messages = [
        'AMAZING!', 'INCREDIBLE!', 'FANTASTIC!', 
        'AWESOME!', 'PERFECT!', 'OUTSTANDING!'
      ];
      const message = messages[Math.floor(Math.random() * messages.length)];
      addFloatingText(message, '#FF6B6B');
    }
  }, [combo]);

  // 關卡特殊效果
  const getLevelEffect = () => {
    switch (currentLevel) {
      case Difficulty.MEDIUM:
        return 'wave-effect';
      case Difficulty.HARD:
        return 'pulse-effect';
      case Difficulty.SUPER:
        return 'rotate-effect';
      case Difficulty.GOD:
        return 'matrix-effect';
      default:
        return '';
    }
  };

  return (
    <div className={`dynamic-effects ${screenShake ? 'screen-shake' : ''} ${colorPulse ? 'color-pulse' : ''}`}>
      {/* 關卡特殊效果 */}
      <div className={`level-effect ${getLevelEffect()}`}>
        {currentLevel === Difficulty.GOD && (
          <div className="matrix-rain">
            {[...Array(20)].map((_, i) => (
              <div key={i} className="matrix-column" style={{ left: `${i * 5}%` }}>
                {[...Array(10)].map((_, j) => (
                  <span key={j} className="matrix-char">
                    {Math.random() > 0.5 ? '1' : '0'}
                  </span>
                ))}
              </div>
            ))}
          </div>
        )}
      </div>

      {/* 漂浮文字 */}
      {floatingTexts.map(text => (
        <div
          key={text.id}
          className="floating-text"
          style={{
            left: text.x,
            top: text.y,
            color: text.color
          }}
        >
          {text.text}
        </div>
      ))}

      {/* 連擊光環效果 */}
      {combo >= 3 && (
        <div className="combo-aura">
          {[...Array(combo)].map((_, i) => (
            <div
              key={i}
              className="aura-ring"
              style={{
                '--delay': `${i * 0.2}s`,
                '--size': `${100 + i * 50}px`
              } as React.CSSProperties}
            />
          ))}
        </div>
      )}

      {/* 時間緊急效果 */}
      {timeRemaining <= 10 && timeRemaining > 0 && (
        <div className="emergency-overlay">
          <div className="emergency-text">
            TIME RUNNING OUT!
          </div>
        </div>
      )}

      {/* 分數里程碑慶祝 */}
      {score > 0 && score % 1000 === 0 && (
        <div className="milestone-celebration">
          <div className="celebration-burst">
            {[...Array(12)].map((_, i) => (
              <div
                key={i}
                className="burst-particle"
                style={{
                  '--angle': `${i * 30}deg`
                } as React.CSSProperties}
              />
            ))}
          </div>
        </div>
      )}
    </div>
  );
};

export default DynamicEffects;
